struct PK(Dat);
struct PV(Dat);
type PKShared = Arc<PK>;
type PVShared = Arc<PV>;
impl Serializable for PKShared {}
impl Serializable for OptDatum<PVShared> {}

struct SV(Dat);
enum SVShared {
Own( Arc<SV> ),
Ref( OwningRef<PVShared, Dat> ),
}

struct SVPKShared {
sv: SVShared,
pk: PKShared,
}
impl Serializable for SVPKShared {}

enum OptDatum<T> {
Tombstone,
Some(T),
}
// Newtype of std::option::Option<T> (which is abbreviated to Opt<T>).
